/**
 * @param {string[]} words
 * @return {number[][]}
 */
var palindromePairs = function(words) {
    let palindromePairs = [];
    for (let i = 0; i < words.length; i++) {
        for (let j = 0; j < words.length; j++) {
            if(i !== j){
                let totalLen = words[i].length+words[j].length;
                let Merged = words[i]+words[j];
                let palindrome = true;
                for (let k = 0; k < Merged.length; k++) {
                    if (Merged[k] !== Merged[Merged.length - 1 - k]) {
                        palindrome = false;
                        break;
                    }
                }
                if(palindrome){
                    palindromePairs.push([i,j]);
                }
                // console.log(totalLen);
                // console.log(Merged);
            }            
        }        
    }
    console.log("Palindrome Count",palindromePairs);
    return palindromePairs;
};
